import React from 'react'

function Coin({name, icon, price,symbol, rank}) {
  return (
    <div className="coin">
        <h3>{rank}</h3>
        <img src={icon}/>
        <h1>{name}</h1>
        <h3>Price: {price}</h3>
        <h3>Symbol: {symbol}</h3>
    </div>
  )
}

export default Coin
